// src/pages/CadastroMedico.js
import React, { useState } from 'react';
import { Container, Row, Col } from 'react-bootstrap'; // Importando Container, Row e Col do Bootstrap
import { useNavigate } from 'react-router-dom';
import '../styles/CadastroMedicoAdmin.css';

function CadastroMedico() {
    const navigate = useNavigate();

    const [nome, setNome] = useState('');
    const [crm, setCrm] = useState('');
    const [especialidade, setEspecialidade] = useState('');
    const [telefone, setTelefone] = useState('');
    const [status, setStatus] = useState(true);

    const handleSubmit = (e) => {
        e.preventDefault();

        const medico = { nome, crm, especialidade, telefone, status };
        
        console.log("MÃ©dico cadastrado:", medico);
        
        navigate('/admin/dashboard');
    };

    return (
        <Container fluid className="cadastro-medico-container vh-100"> {/* Adicionando vh-100 para ocupar toda a altura da janela */}
            <Row className="h-100"> {/* H-100 para ocupar toda a altura do contÃªiner */}
                <Col md={12} className="d-flex flex-column justify-content-center align-items-center h-100"> {/* Usando d-flex para centralizar */}
                    <h2>Cadastro de MÃ©dico</h2>
                    <form onSubmit={handleSubmit} className="form-cadastro-medico w-100"> {/* w-100 para largura total */}
                        <div className="form-group">
                            <label>Nome Completo</label>
                            <input 
                                type="text" 
                                className="form-control" 
                                value={nome} 
                                onChange={(e) => setNome(e.target.value)} 
                                required 
                            />
                        </div>

                        <div className="form-group">
                            <label>CRM</label>
                            <input 
                                type="text" 
                                className="form-control" 
                                value={crm} 
                                onChange={(e) => setCrm(e.target.value)} 
                                required 
                            />
                        </div>

                        <div className="form-group">
                            <label>Especialidade</label>
                            <select 
                                className="form-control" 
                                value={especialidade} 
                                onChange={(e) => setEspecialidade(e.target.value)} 
                                required
                            >
                                <option value="">Selecione uma especialidade</option>
                                <option value="ClÃ­nico Geral">ClÃ­nico Geral</option>
                                <option value="Cardiologia">Cardiologia</option>
                                <option value="Dermatologia">Dermatologia</option>
                                <option value="Pediatria">Pediatria</option>
                                <option value="Ortopedia">Ortopedia</option>
                            </select>
                        </div>

                        <div className="form-group">
                            <label>Telefone</label>
                            <input 
                                type="tel" 
                                className="form-control" 
                                value={telefone} 
                                onChange={(e) => setTelefone(e.target.value)} 
                                required 
                            />
                        </div>

                        <div className="form-group form-check">
                            <input 
                                type="checkbox" 
                                className="form-check-input" 
                                checked={status} 
                                onChange={(e) => setStatus(e.target.checked)} 
                            />
                            <label className="form-check-label">Status Ativo</label>
                        </div>

                        <div className="button-group">
                            <button type="submit" className="btn btn-primary">Cadastrar MÃ©dico</button>
                            <button 
                                type="button" 
                                className="btn btn-outline-secondary" 
                                onClick={() => navigate('/admin/dashboard')}
                            >
                                Cancelar
                            </button>
                        </div>
                    </form>
                </Col>
            </Row>
        </Container>
    );
}

export default CadastroMedico;
